script: |
  super -f text -I q2557.spq | sort > q2557.out

inputs:
  - name: q2557.spq
    data: |
      SELECT - col1 * ( col1 ) * - + col2, + col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT NULL BETWEEN - ( col0 ) AND - col2 * - col1 + + col0 - 61;
  - name: tab0

outputs:
  - name: q2557.out
    data: |
